import {
  AreaChart,
  Area,
  CartesianGrid,
  XAxis,
  YAxis,
  Tooltip,
} from "recharts";

const data = [
  {
    netCap: "4",
    date: "2020-07-02"
  },
  {
    netCap: "7.3",
    date: "2020-07-03"
  },
  {
    netCap: "6",
    date: "2020-07-04"
  },
  {
    netCap: "5",
    date: "2020-07-05"
  },
];

const renderLineChart = (
  <LineChart width={700} height={300} data={data}>
    <CartesianGrid stroke="#ccc" strokeDasharray="5 5" />
    <YAxis />
    <XAxis />
    <Line type="monotone" dataKey="netCap" stroke="#8884d8"  strokeWidth={2} />
  </LineChart>
);

export const NetCapLine = () => {
  return (
    <>
      <h2>Sector Size</h2>
      <div style={{marginLeft: "10rem"}}>{renderLineChart}</div>
    </>
  );
}

export default NetCapLine;
